/* the first command drops the objects you created in the previous pracs */
/* if you haven't created these tables, the DROP commands will result in error messages. Just ignore the messages */
DROP TABLE PROJECT;
DROP TABLE EMP;

/* recreate the EMP table */
CREATE TABLE EMP ( 
	EMPNO NUMERIC(9),
	ENAME VARCHAR(100),
	JOB VARCHAR(40),
	NATIONALITY VARCHAR(100),
	SEX VARCHAR(20) 
);

CREATE TABLE PROJECT ( 
	PROJECTID NUMERIC(4),
	PROJECTNAME VARCHAR(40) ,
	PROJECTLEADER NUMERIC(9) 
);




